import logo from './logo.svg';
import './App.css';

import RegisterForm from './components/RegisterForm';
import RegisterPortada from './components/RegisterPortada';

function App() {
  return (
    <div className='App'>
      <div className='leftBox'>
        <RegisterForm />
      </div>
      <div className='leftBox'>
        <RegisterPortada />
      </div>
    </div>
  );
}

export default App;
